{"image_url":"https://kvsfwvxlmrtbzafznczd.supabase.co/storage/v1/object/public/drink-images/b7d68135-b16f-4efd-89e9-dc9180061ef1/1769480370262.jpg","location":null,"name":"St Antonin Châteauneuf Du Pape 2022","notes":"Châteauneuf-du-Pape wines are typically full-bodied with rich flavors of red and black fruits, often accompanied by notes of garrigue (herbs like thyme and rosemary), spice, and earthy undertones. The 2022 vintage is likely to be young and vibrant.

St Antonin is a producer of wine in the Châteauneuf-du-Pape appellation in the Southern Rhône Valley of France. Châteauneuf-du-Pape is renowned for its specific bottle embossing featuring the papal tiara and St. Peter's keys, signifying its historical connection to the Avignon Papacy.

This red wine pairs wonderfully with roasted red meats, hearty stews, game dishes, and strong cheeses. Serve at cellar temperature (around 16-18°C) after decanting young vintages for an hour or so.","rating":5,"type":"wine"}

{"image_url":"https://kvsfwvxlmrtbzafznczd.supabase.co/storage/v1/object/public/drink-images/b7d68135-b16f-4efd-89e9-dc9180061ef1/1769480432492.jpg","location":null,"name":"José Ignacio Albariño 2024","notes":"Albariño wines are typically crisp and aromatic with notes of citrus, green apple, and sometimes a hint of salinity and minerality. The 2024 vintage would be expected to be fresh and vibrant.

Bodega Oceánica is a winery located in Uruguay, specifically Finca José Ignacio. They are known for producing wines that reflect the unique coastal terroir of the region, often focusing on varietals well-suited to the climate.

Best served chilled. This Albariño would pair wonderfully with seafood, grilled chicken, fresh salads, or light appetizers. It's also a great choice for sipping on a warm day.","rating":5,"type":"wine"}

{"image_url":"https://kvsfwvxlmrtbzafznczd.supabase.co/storage/v1/object/public/drink-images/b7d68135-b16f-4efd-89e9-dc9180061ef1/1769480571046.jpg","location":null,"name":"Lieutenant de Sigalas Sauternes 2010","notes":"Sauternes is a sweet white wine known for its complex aromas of honey, apricot, intense botrytis (noble rot) notes, and often orange marmalade. The 2010 vintage would likely show a beautiful balance of richness and acidity.

Château Sigalas Rabaud is one of the oldest and most prestigious estates in the Sauternes appellation of Bordeaux, France. It was classified as a Premier Cru Classé in 1855, signifying its high quality and historical importance. 'Lieutenant de Sigalas' is typically the second wine of the Château, offering a more accessible expression of their winemaking.

This sweet wine is traditionally served chilled and pairs excellently with foie gras, blue cheeses, or fruit-based desserts like tarte Tatin. It can also be enjoyed on its own as a dessert in a glass.","rating":5,"type":"wine"}

{"image_url":"https://kvsfwvxlmrtbzafznczd.supabase.co/storage/v1/object/public/drink-images/b7d68135-b16f-4efd-89e9-dc9180061ef1/1769480618992.jpg","location":null,"name":"Royal Tokaji 5 Puttonyos Aszú 2017","notes":"This sweet dessert wine typically exhibits rich aromas of apricot, honey, orange peel, and botrytis, with a luscious palate balanced by vibrant acidity.

Royal Tokaji is a renowned winery in the Tokaj region of Hungary, famous for its sweet 'aszú' wines. The number '5 Puttonyos' refers to the sweetness level, indicating a higher concentration of botrytized grapes used in its production.

Best served chilled as a dessert wine, it pairs wonderfully with foie gras, blue cheeses, fruit tarts, or simply on its own as a contemplative sip.","rating":4,"type":"wine"}

{"image_url":"drink-images/b7d68135-b16f-4efd-89e9-dc9180061ef1/1770975675944.jpg","location":"Cooper and Oak","name":"Ichiro's Malt Chichibu 'On The Way' (Floor Malted 2024)","notes":"Chichibu whiskies are known for their lively and complex character. This particular expression, being 'Floor Malted', likely offers a unique malty sweetness with potential notes of honey, fruit, and a subtle spice, reflecting its Japanese oak (Mizunara) or ex-bourbon aging.

Ichiro's Malt is produced at the Chichibu Distillery in Japan, founded by Ichiro Akuto, a grandson of the founder of the Hanyu Distillery. Chichibu is renowned for its small-batch, handcrafted approach and using traditional techniques, including floor malting, to create highly sought-after Japanese single malts.

This is a premium Japanese single malt best enjoyed neat in a Glencairn glass to appreciate its full aromatic and flavor profile. It pairs well with thoughtful reflection or a quiet moment.","rating":5,"type":"whiskey"}
